import {Component, OnInit, ViewChild} from "@angular/core";
import {Router} from "@angular/router";
import {AuthHttpError, JwtHelper} from "angular2-jwt";
import {CurrentUser} from "../../../+dto/currentUser";
import {AssignedRole} from "../../../+dto/assignedRole";
import {DocumentoEmpleado} from "../../../+dto/maintenance/documentoEmpleado";
import {FotoHeaderFormComponent} from "./foto-header.form.component";
import {Adjunto} from "../../../+personal/+empleado/adjunto";
import {Message} from "primeng/components/common/api";
import {EmpleadoService} from "../../../+common/service/empleado.service";
import {Empleado} from "../../../+dto/maintenance/empleado";
import {BackendService} from "../../../+rest/backend.service";
import {ModuloService} from "../navigation/http-modulo-service";
import {Modulo} from "../../../+dto/maintenance/modulo";
import {ChangeRolModel} from "../../../+dto/changeRolModel";
import {PushNotificationsService} from "angular2-notifications";
import {AlertaEmpleado} from "../../../+dto/maintenance/alertaEmpleado";
import {ComponentBase} from "../../../+common/service/componentBase";

declare var $: any;

@Component({
    selector: 'sa-header',
    templateUrl: './header.component.html',
})
export class HeaderComponent extends ComponentBase implements OnInit {

    nombreCompleto: string;
    private rolAsignado: Array<AssignedRole> = [];
    jwtHelper: JwtHelper = new JwtHelper();
    currentUser: CurrentUser = new CurrentUser();

    public empleado: Empleado = new Empleado();
    public fotoEmpleado: DocumentoEmpleado;
    //foto
    public dataItemFoto: Adjunto;

    fotoUsuario: string = "";
    rolesAsignados: string = "";
    private roleDefaultName: string;
    private roleDefaultNameChanged: string;
    private roleDefaultNameOld: string;

    msgs: Message[] = [];
    modulos: Array<Modulo>;
    changeRolModel: ChangeRolModel;
    public alertaEmpleadoDto: Array<AlertaEmpleado> = [];

    @ViewChild(FotoHeaderFormComponent) protected fotoFormComponent: FotoHeaderFormComponent;

    constructor(public backendService: BackendService,
                private moduloService: ModuloService,
                private empleadoService: EmpleadoService,
                private router: Router,
                private _push: PushNotificationsService) {
        super(backendService,'AU002');

        var token = localStorage.getItem('id_token');

        if (token) {
            var decoded = this.jwtHelper.decodeToken(token);
            this.nombreCompleto = decoded.empleado;
            this.currentUser = JSON.parse(sessionStorage.getItem("authenticatedUser") || '{}');
            this.rolAsignado = this.currentUser.assignedRoles;
            this._push.requestPermission();
            this.getAlertaEmpleado();

            this.rolesAsignados = this.obtenerRolesAsignados(this.rolAsignado);

            if (this.currentUser.foto) {
                this.fotoUsuario = "data:image/jpeg;base64," + this.currentUser.foto;
            } else {

                if (this.currentUser.genero === "M") {
                    this.fotoUsuario = "data:image/png;base64,";
                } else {
                    this.fotoUsuario = "data:image/png;base64,";
                }


            }


        }
    }

    private refreshModule(value: any){
        this.currentUser = JSON.parse(sessionStorage.getItem("authenticatedUser") || '{}');
        let cuentaUsuario = this.currentUser.cuentaUsuario;
        this.roleDefaultNameChanged = value.roleName;
        $.SmartMessageBox({
            title : "<i class='fa fa-refresh txt-color-orangeDark'></i>Est seguro que desea cambiar de rol<span class='txt-color-orangeDark'><strong>" + $('#show-shortcut').text() + "</strong></span> ?",
            content : "La visualizacin de los mdulos del men y las acciones disponibles cambiarn en base a los privilegios del rol seleccionado.",
            buttons : '[No][Si]'

        }, (ButtonPressed) => {
            if (ButtonPressed == "Si") {
                this.moduloService.updateDefaultRole(cuentaUsuario,value.roleName).subscribe(
                    data =>{
                        this.refreshPage(data);
                    },
                    error => {
                        this.backendService.handleError(error);
                    }
                );
            }
        });
    }

    private refreshPage(data: ChangeRolModel){
        let rolActual = this.roleDefaultNameChanged;
        this.changeRolModel = data;
        sessionStorage.clear();
        localStorage.setItem("modulos", JSON.stringify(this.changeRolModel.modulos));
        sessionStorage.setItem("authenticatedUser", JSON.stringify(this.changeRolModel.currentUser));

        if(rolActual == 'RHANA' && this.roleDefaultNameOld != 'RHANA'){
            this.router.navigate(['/dashboard/principalAnalistaRRHH']);
            location.reload();
        }
        if(rolActual == 'EMPLE' && this.roleDefaultNameOld != 'EMPLE'){
            this.router.navigate(['/dashboard/principal']);
            location.reload();
        }
        if(rolActual == 'GEREN' && this.roleDefaultNameOld != 'GEREN'){
            this.router.navigate(['/dashboard/principalJefe']);
            location.reload();
        }
        if(rolActual == 'ADMIN' && this.roleDefaultNameOld != 'ADMIN'){
            this.router.navigate(['/dashboard/']);
            location.reload();
        }

    }

    private obtenerRolesAsignados(rolAsignado: Array<AssignedRole>) {
        let rpta: string = "";
        let encontro: boolean = false;
        for (var i = 0; i < rolAsignado.length; i++) {
            if (rolAsignado[i].assigned === true && rolAsignado[i].roleDefault === true) {
                this.roleDefaultName = rolAsignado[i].roleDescription;
                this.roleDefaultNameOld = rolAsignado[i].roleName;
            }
            if (!encontro && rolAsignado[i].assigned === true) {
                rpta = rolAsignado[i].roleDescription;
                encontro = true;
                continue;
            }
            if (encontro && rolAsignado[i].assigned === true) {
                rpta = rpta + " | " + rolAsignado[i].roleDescription;
            }
        }

        return rpta;
    }

    ngOnInit() {

    }


    searchMobileActive = false;

    toggleSearchMobile() {
        this.searchMobileActive = !this.searchMobileActive;

        $('body').toggleClass('search-mobile', this.searchMobileActive);
    }

    onSubmit() {
        this.router.navigate(['/miscellaneous/search']);

    }



    public onCancelarImagen(): void {
        this.dataItemFoto = undefined;
    }

    public subirImagen(): void {

        this.fotoFormComponent.subirImagen();
    }

    public onAceptarImagen(dto: Adjunto): void {


        if (dto.content != undefined) {

            this.fotoEmpleado = new DocumentoEmpleado(-100, 'Foto Empleado', dto.content, dto.contentType, dto.name, 'FO');

            this.fotoUsuario = "data:image/jpeg;base64," + dto.content;

            this.empleado.idEmpleado = this.currentUser.idEmpleado;
            this.empleado.fotoPerfil = this.fotoEmpleado;


            this.empleadoService.registrarFotoEmpleado(this.empleado).subscribe(
                data => {

                    this.backendService.notification(this.msgs, data);


                },
                error => {

                    this.backendService.notification(this.msgs, error);
                }
            );


        }

    }

    private getAlertaEmpleado() {
        this.empleado.idEmpleado = this.currentUser.idEmpleado;
        this.empleadoService.obtenerMensajeAlertaEmpleado(this.empleado).subscribe(
            data => {

                this.obtenerMensajeAlertaEmpleado(data);
            },
            error => {
                this.backendService.notification(this.msgs, error);
            }
        );
    }

    private obtenerMensajeAlertaEmpleado(alertaDto:AlertaEmpleado[]): void {
        this.alertaEmpleadoDto = alertaDto;

        if(this.alertaEmpleadoDto.length>0){
            for(let i=0; i<this.alertaEmpleadoDto.length; i++) {
                for(let rolVal of this.alertaEmpleadoDto[i].estado){
                    let options = {
                        body: this.alertaEmpleadoDto[i].mensaje,
                        icon: 'http://'+this.frontEndURL+':'+ this.frontEndPort +'/assets/img/runakuna-logo-alert.png'
                    }
                    debugger;
                    this._push.create('Mensaje', options).subscribe(
                        res => res
                    )
                }
            }
        }else{
        }


    }

}
